import { Svg, Line, Circle } from "react-native-svg";
import TrebleClef from "../images/TrebleClef.svg";
import { View, StyleSheet, Image } from "react-native";
import { Lines } from "./Lines";

const Playground = () => {
  return (
    <View style={style.treble}>
      <TrebleClef height={100} width={100}></TrebleClef>
      <Lines></Lines>
    </View>
  );
};

const style = StyleSheet.create({
  playground: {
    flex: 1,
    padding: 200,
    height: 200
  },
  treble: {
    position: "absolute"
  }
});

export { Playground };
